body:
I am doing a project in the GoLanguage and use GoLand by Jetbrains as an IDE.
GoLand shows me in the IDE an error message ("unresolved reference"), but still compiles and runs correctly. 
Here is a similar (but simpler) example of some code that I have found here on stackoverflow (Go - append to slice in struct). The same error message appears. But obviously I have implemented the method just a few lines above. 
package main

import (
"fmt"
)

 type MyBoxItem struct {
Name string
 }

 type MyBox struct {
Items []MyBoxItem
 }

func (box *MyBox) AddItem(item MyBoxItem) {
box.Items = append(box.Items, item)
}


 func main() {

item1 := MyBoxItem{Name: "Test Item 1"}
item2 := MyBoxItem{Name: "Test Item 2"}

box := MyBox{}

box.AddItem(item1)
box.AddItem(item2)

// checking the output
fmt.Println(len(box.Items))
fmt.Println(box.Items)
}

box.AddItem(item1) and box.AddItem(item2) are marked red as an error. If I move my cursor above it it says (unresolved reference "AddItem"). Yet the code compiles and runs. And as this was the solution to an other stackoverflow question, I do not think that the code is wrong. Furthermore I cannot find any mistakes in it.

Can someone help? Thanks a lot
[EDIT: I load the code from a remote server and edit it locally on my private pc. After finishing my changes, I upload it to the remote server (using GoLands tools like "Browse remote host") and build and compile it there. After trying it out locally with the very same code, the error message sometimes is there and sometimes not. I am totally confused]

Why are we using dispose() method? I'm little confused about it.
what will be issue occurs If we don't use it and what's the benefit of using it?
@override
  void dispose() {
    // TODO: implement dispose
    super.dispose();
  }

Using both Java 8 and Java 11, consider the following TreeSet with a String::compareToIgnoreCase comparator:
final Set<String> languages = new TreeSet<>(String::compareToIgnoreCase);
languages.add("java");
languages.add("c++");
languages.add("python");

System.out.println(languages);                 // [c++, java, python]

When I try to remove the exact elements present in the TreeSet, it works: all of those specified are removed:
languages.removeAll(Arrays.asList("PYTHON", "C++"));

System.out.println(languages);                 // [java]

However, if I try to remove instead more than is present in the TreeSet, the call doesn't remove anything at all (this is not a subsequent call but called instead of the snippet above):
languages.removeAll(Arrays.asList("PYTHON", "C++", "LISP"));

System.out.println(languages);                 // [c++, java, python]

What am I doing wrong? Why does it behave this way?
Edit: String::compareToIgnoreCase is a valid comparator:
(l, r) -> l.compareToIgnoreCase(r)
